INSERT INTO `nilai` VALUES ('376','21','15','31','SAS','2023-12-28 09:27:19','2023-12-28 10:17:53','2023-12-28 10:17:58','0','0',NULL,'NAN','NAN',NULL,'192.168.0.102','1','a:0:{}','a:20:{i:1480;s:79:\"<p><em><strong>menjalankan perintah allah dan menjauhi larang</strong></em></p>\";i:1481;s:92:\"<p><strong>berhias diri dengan perkara yang baik membersihkan diri dari perkara</strong></p>\";i:1482;s:116:\"<p>Menyadari bahwa kita sebagai hamba yang hina besyukur atas nikmat yang telah allah berikan mengingat kematian</p>\";i:1483;s:82:\"<p>1rezeki lancar</p><p>2mendapat kebahagiaan</p><p>3mendapat syurga di akhira</p>\";i:1484;s:87:\"<p>Sesungguhnya allah bersama orang orang yang bertakwa dan orang yang berbuat baik</p>\";i:1485;s:81:\"<p>Di siplin memberikan contoh yang baik bagi murid tidak boleh membandingkan</p>\";i:1486;s:89:\"<p>1Tawadu`</p><p>2berkata jujur</p><p>3tidak ujub/riya`</p><p>4Tidak sum`ah/takabbur</p>\";i:1487;s:201:\"<p>1tidak berbicara dengan suara yang lancang/keras</p><p>2tidak mendahului berjalan ketika bertemu dengan guru</p><p>3tidak boleh mengetes kemampuan guru</p><p>4tunduk</p><p>5tidak berkata \"uh ah\"</p>\";i:1488;s:138:\"<p>1menghormati</p><p>2tidak melecehkan</p><p>3tidak menghina</p><p>4tidak melakukan tindakan kriminal</p><p>5menghargai tidak membuli</p>\";i:1489;s:74:\"<p>1patuh</p><p>2tunduk</p><p>3sopan</p><p>4berbakti</p><p>5menghargai</p>\";i:1490;s:9:\"<p>50</p>\";i:1491;s:39:\"<p>Adanya alam semesta</p><p>&nbsp;</p>\";i:1492;s:93:\"<p>Kiddib=bohong</p><p>Khianat=berkhianat</p><p>Kitman=menyembunyikan</p><p>Balasan=bodoh</p>\";i:1493;s:89:\"<p>Ikatan atau perjanjian/suatu pokok atau dasar keyakinan yang harus di pegang teguh</p>\";i:1494;s:96:\"<p>Berbuat baik/berbakti dan mengabdikan diri kepada allah didasarkan atas kesadaran dan kei</p>\";i:1495;s:176:\"<p>Patuh tunduk menyerahkan diri dan selamat/tunduk sepenuhnya dan pasrah terhadap apa yang di bawa oleh nabi muhammad SAW yang mengajarkan agar manusia tunduk kepada allah</