INSERT INTO `nilai` VALUES ('377','21','15','23','SAS','2023-12-28 09:27:20','2023-12-28 10:22:48','2023-12-28 10:23:02','0','0',NULL,'NAN','NAN',NULL,'192.168.0.105','1','a:0:{}','a:20:{i:1480;s:122:\"<p style=\"text-align: center;\">Mantaati perintah nya dan menjauhi larangannya</p><p style=\"text-align: center;\">&nbsp;</p>\";i:1481;s:87:\"<p>Berhias diri dengan perkara yang baik membersih kan diri dari perkara yang buruk</p>\";i:1482;s:82:\"<p>Hamba yang hina bersyukur atas nikmat yang Allah berikan mengingat kematian</p>\";i:1483;s:70:\"<p>Rezeki lancarmendapat kebahagiaan dan mendapat surga di akhirat</p>\";i:1484;s:93:\"<p><strong>sesungguhnya allah bersama orang yang bertaqwa dan orang yang terbaik</strong></p>\";i:1485;s:84:\"<p>Disiplin memberikan contoh yang baik bagi murid tidak boleh membandingkan nya</p>\";i:1486;s:66:\"<p style=\"text-align: justify;\">Tawadduk tawakal berkata jujur</p>\";i:1487;s:49:\"<p>Tidak berbicara dengan suara lantang&nbsp;</p>\";i:1488;s:67:\"<p>Menghormati tidak meleceh kan tidak melakukan tindakan krimi</p>\";i:1489;s:18:\"<p>Patut tundu</p>\";i:1490;s:116:\"<p>Ada 50 sifat bagi allah 20 yang muhal 20 yang jais nabi 1 dan bagi Allah 1sifat wajib bagi nabi 4yang muhal 4</p>\";i:1491;s:54:\"<p style=\"text-align: center;\">Adanya semesta alam</p>\";i:1492;s:71:\"<p>Kiddib bohong hianat berhianak kitman menyampaikan baladah bodoh</p>\";i:1493;s:24:\"<p>Ikatan perjanjian</p>\";i:1494;s:134:\"<p style=\"text-align: justify;\">Berbuat baik berbakti dan mengabdikan diri pada Allah dg di dasarkan atas kesadaran dan keikhlasan</p>\";i:1495;s:43:\"<p>Patut tundukmenyerahkan diri selamat</p>\";i:1496;s:12:\"<p>ada 3</p>\";i:1497;s:49:\"<ul><li>Fiklu kulli mumkinin aw tarkuhu</li></ul>\";i:1498;s:53:\"<p>Al akrodu albasariun Al Lati latuaddi lanafsin</p>\";i:1499;s:35:\"<p>Tablig Fatonah amanah siddiq</p>\";}',NULL,'0','1484,1490,1497,1491,1480,1493,1483,1481,1485,1494,1495,1489,1496,1487,1488,1492,1482,1499,1486,1498,','',NULL,'0');
