INSERT INTO `soal` VALUES ('5','1','5','Perhatikan artikel berikut!Jantung merupakan organ yang berbentuk seperti kerucut.Jantung terletak di tengah dada bagian dalam.Jantung merupakan bagian organ yang tebal, berotot, dan mempunyai empat bilik. Rata-rata jantung memiliki ukuran panjang kira-kira 13 cm, lebar 9 cm, dan tebal 6 cm, berat jantung sekitar 300 gram.Pernyataan tersebut merupakan struktur dari teks laporan, yaitu &hellip;','1','Pernyataan umum ','Aspek yang dilaporkan','Reaksi','Koda','Argumen','B',NULL,'','','','','','');
