INSERT INTO `soal` VALUES ('14','1','14',' Teks laporan hasil observasi harus disajikan dengan menggunakan bahasa yang jelas, mudah dipahami, dan tidak berbelit-belit. Hal ini dilakukan untuk menghindari &hellip;','1','kesalahpahaman pembaca',' keterlibatan tokoh masyarakat',' kesalahan penulisan',' Sifat tafsir',' salah menguraikan pendapat/opini','A',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('15','1','15',' Perhatikan teks laporan hasil observasi berikut !Makhluk di dunia ini dibedakan menjadi dua jenis secara umum, yakni makhluk yang hanya bisa bergerak dan berperasaan serta makhluk yang bisa bergerak, berperasaan, dan berpikir (makhluk yang sempurna). Klasifikasi ini didasarkan atas anugerah Tuhan Yang Maha Esa kepada Manusia sebagai makhluk ciptaan Tuhan yang lainnya.Tema teks laporan hasil observasi di atas adalah &hellip;','1','keagungan manusia',' Makhluk ciptaan tuhan',' kesempurnaan Tuhan',' Ciri-ciri manusia',' dua makhluk yang berbeda','B',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('16','1','16','Kalimat dalam teks anekdot berikut yang merupakan kalimat imperatif adalah &hellip;','1','Si pejabat ini tergelincir dan terperosok ke sungai.','Seorang kawan Nasruddin membungkuk ke tepi sungai dan mengulurkan tangannya.','&quot;Berikanlah tanganmu,&quot; kata si kawan Nasruddin.','Namun, si pejabat tersebut hanya diam saja.','&quot;Kau keliru,&quot; ujar Nasruddin kepada kawannya ini.','C',NULL,'','','','','','');
