INSERT INTO `soal` VALUES ('25','1','25','Suatu hari guru menerangkan tentang biopori di depan kelas. &ldquo; Biopori itu bisa dijadikan sebagai salah satu usaha menghindari banjir&rdquo;jelasnya. &ldquo;Sekarang, Ibu beri tugas pada kalian untuk membuat biopori di sekitar rumah, lalu kalian foto.Fotonya nanti ditempel di buku tugas dan berikan deskripsi&rdquo;.Tiba-tiba seorang anak berkomentar.&rdquo;Syukurlah Bu, jalan menuju rumah saya sudah banyak bioporinya, tapi kata bapak itu bukan untuk menanggulangi banjir, melainkan biopori akibat sering banjir&rdquo;. Mendengar itu semua anak dan Bu guru tertawa.Kalimat yang menunjukkan krisis adalah ...','1','Suatu hari guru menerangkan tentang biopori di depan kelas.','&ldquo;Biopori itu bisa dijadikan sebagai salah satu usaha menghindari banjir&rdquo;jelasnya','Sekarang, Ibu beri tugas pada kalian untuk membuat biopori di sekitar rumah, lalu kalian foto.','&rdquo;Syukurlah Bu, jalan menuju rumah saya sudah banyak bioporinya, tapi kata bapak itu bukan untuk menanggulangi banjir, melainkan biopori akibat sering banjir&rdquo;','Mendengar itu semua anak dan Bu guru tertawa','D',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('26','1','26','Susunlah anekdot berikut ini sesuai dengan strukturnya!(1) Bu guru pun tersenyum(2) Siapa yang bisa membuat perumpamaan bagi penegakan hukum di negeri kita? Tanya Bu guru di depan kelas.(3) Bu guru bertanya kenapa disebut hukum kantong kresek(4) Tidak lama kemudian seorang anak menjawab dengan lantang(5) Hukum kantong kresek Bu, kata anak itu.(6) Hanya bisa menyelesaikan kasus kecil Bu, kalau kasus besar tidak pernah muat.','1','1-2-3-4-5-6','2-4-5-3-6-1','2-4-3-5-1-6','1-2-4-5-3-6','3-2-1-4-5-6','B',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('27','1','27','Berikut ini yang bukan ciri-ciri teks anekdot adalah &hellip;','1','struktur teks orientasi-krisis-reaksi','memiliki pesan moral','memiliki unsur lucu','berbentuk cerita','menggelitik','D',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('28','1','28','Berikut ini , yang termasuk teks anekdot adalah &hellip;','1','Harimau (Panthera tigris) digolongkan ke dalam mamalia, yaitu binatang yang menyusui. &ldquo;Kucing besar&rdquo;itu adalah hewan pemangsa dan pemakan daging. Harimau dapat mencapai tinggi 1,5 meter, panjang 3,3 meter, dan berat 300 kilogram. Bulunya berwarna putih dan cokelat keemasan-emasan dengan belang atau loreng berwarna hitam','Saudara-saudara yang saya hormati, Beberapa hari yang lalu, masyarakat sedang merayakan pesta demokrasi&mdash;memilih presiden dan wakil presiden secara langsung.Saya berharap, siapapun yang menjadi presiden dan wakil presiden, kita harus berlapang dada untuk menerima segala kebijakannya','Pernahkah Anda membuat SIM, misalnya SIM C? Mengurus SIM tentu memerlukan waktu dan biaya. Tulisan ini bertujuan untuk berbagi pengalaman dalam mengurus SIM C dengan jalan yang benar','Perdagangan bebas yang diusung oleh sebuah negara dipastikan dapat menguntungkan atau merugikan negara yang bersangkutan. Dampak negatif kebijakan politik negara di sektor ekonomi ini mudah kita temukan di Indonesia.','Ibu-ibu sedang kerja bakti membersihkan jalan desa pada pagi hari.Suasana terkesan ramai, obrolan seputar harga, gosip, dan anak.&ldquo;Wah, bulan ini banyak pangeluaran. Anak saya masuk kuliah dan adiknya masuk SMA,&rdquo; kata Bu Tini &ldquo;Semua ternak saya, saya sekolahkan Bu biar pintar&rdquo; sambung Bu Tini &ldquo;He..he..he&rdquo; tawa Bu Romlah renyah Mereka pun melanjutkan membersihkan rumput di kanan dan kiri','E',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('29','1','29','Yang merupakan tujuan penulisan teks anekdot, yaitu &hellip;','1','Memberi petunjuk','Memberi argumentasi','Membuat bingung',' Menghibur','Menganalisis','D',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('30','1','30','Sindiran dalam teks anekdot dapat diungkapkan dengan antonim. Pasangan kata dibawah ini yang merupakan antonim, kecuali &hellip;','1',' Benar- Salah',' adil - tidak adil',' kaya - miskin','rajin - malas',' target - sasaran','E',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('31','1','31',' Bacalah penggalan hikayat berikut dengan saksama!Pengganti Hang Tuah di keraton adalah Hang Jebat. Sesungguhnya, ia menaruh dendam atas keputusan raja yang dijatuhkan kepada sahabatnya, Hang Tuah. Karena setia kepada sahabatnya, ia mengamuk di keraton. Putri-putri dan dayang-dayang diperlakukan kurang sopan sehingga banyak jugalah orang yang mati karena kerisnya, yang diberikan Hang Tuah kepadanya. Tiada seorang pun yang berani mendinginkan sehingga raja sendiri pun terlibat pula dalam kesulitan dan ketakutan.Dari kutipan cerita di atas kita dapat mengetahui bahwa Hang Jebat berwatak &hellip;','1',' Pemberani',' Baik budi',' Kasar',' Sombong',' SetiaKunci :C','E',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('32','1','32',' Bacalah penggalan hikayat &ldquo;Indera Bangsawan&rdquo; berikut! Maka anakanda baginda yang dua orang itu pun sampailah usia tujuh tahun dan dititahkan pergi mengaji kepada Mualim Sufian. Sesudah tahu mengaji, mereka dititah pula mengaji kitab usul, fikih, hingga saraf, tafsir sekaliannya diketahuinya.Sumber teks: Buku Kesusastraan Melayu Klasik. Nilai yang terkandung pada penggalan hikayat di atas yaitu ...','1',' Nilai moral',' Nilai agama',' Nilai budaya',' Nilai pendidikan',' Nilai sosial','D',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('33','1','33','  (1) bersifat imajinasi.(2) mengisahkan tentang kerajaan.(3) nama penciptanya tidak diketahui.(4) bersifat menyindir.(5) bersifat menghibur.Nomor berapakah yang merupakan ciri-ciri hikayat ...','1','(1), (3), (5)',' (2), (4), (5)',' (1), (2), (3)',' (1), (4), (5)',' (3), (4), (5)','C',NULL,'','','','','','');
