INSERT INTO `soal` VALUES ('35','1','35',' Hikayat terdiri dari unsur intrinsik dan ekstrinsik. Yang termasuk unsur intrinsik meliputi &hellip;','1',' Tema, latar, toko, penokohan, dan sudut pandang.',' Tema, jalan cerita, orang yang terlibat, tokoh, sudut pandang, dan antagonis.',' Tema, toko, penokohan, latar, alur, amanat, dan sudut pandang.',' Pesan, amanat, tokoh,penokohan, latar, alur, dan sudut pandang.',' Tema, tokoh, penokohan, latar, alur, amanat, dan sudut pandang.','E',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('36','1','36',' Bacalah teks berikut!Maka diberi oleh perempuan itu segala bekal-bekal itu. Setelah sudah maka dibawanyalah perempuan itu diseberangkan oleh Bedawi itu. Syahdan maka pura-pura diperdalamnya air itu, supaya dikata oleh si bungkuk air itu dalam.Konjungsi arkais yang terdapat dalam kutipan tersebut adalah &hellip;','1',' Maka',' Syahdan',' Supaya','Setelah',' Sudah','B',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('37','1','37',' Cermati paragraf berikut!Bencana alam membuat warga sangat menderita. Mereka harus tinggal dipengungsian, kehilangan aktivitas &hellip; mata pencaharian. Dini hari kemarin, curah hujan yang tinggi telah menjebol tanggul &hellip; menahan luapan lumpur panas di Porong. Sidoarjo. Lumpur yang bercampur air &hellip; merendam jalan raya serta rel kereta api, &hellip; merendam sekitar 200 rumah di Desa Ketapang dan Siring barat. Langkah pengamanan darurat harus segera dilakukan untuk menyelamatkan para korban agar tidak lebih menderita karena bencana.Kata penghubung yang tepat untuk melengkapi bagian yang rumpang pada paragraf tersebut adalah &hellip;','1','dan, yang, tidak, hanya, tetapi juga',' lagi pula, tempat, bukan hanya, tetapi juga',' serta, untuk, bukan, melainkan',' atau, agar, tidak hanya, melainkan juga',' juga, lalu, tidak, tetapi','A',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('38','1','38','Bacalah teks berikut!Sebermula ada sebulan selangnya, maka pada suatu hari raja semayam di balairung diadap oleh segala menteri hulubalang dan rakyat sekalian. Maka barang siapa bercakap mengobati raja itu, jikalau sembuh penyakitnya, diambil raja akan menantu.Karakteristik yang menggambarkan bahwa naskah tersebut hikayat adalah &hellip;','1','istanasentris dan kesaktian',' istanasentris dan struktur kalimat',' struktur kalimat rancu dan kemustahilan',' kemustahilan, tokohnya binatang','tokohnya binatang, kesaktian seseorang','A',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('39','1','39','Salah satu ciri hikayat adalah anonim, yang berarti &hellip;','1',' mempunyai logika tersendiri yang tidak sama dengan logika umum, ada juga yang menyebut fantastis',' menggunakan bahasa yang diulang-ulang',' pengarangnya tidak dikenali',' meneruskan budaya/tradisi/kebiasaan yang dianggap baik',' menceritakan tokoh yang berkaitan dengan kehidupan istana/kerajaan','C',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('40','1','40',' Hikayat bersifat istana sentris, banyak menggunakan gaya bahasa klise, dan alurnya mudah ditebak sehingga cenderung monoton. Hal ini berbeda dengan karya sastra baru seperti cerpen yang memiliki ...','1',' gaya bahasa bebas',' alur lebih dinamis',' gaya bahasa teratur',' alur mengikuti aturan',' gaya bahasa bebas dan alur lebih dinamis','E',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('41','1','41',' Bacalah teks berikut!Maka berapa lama, mereka pun kembali ke Bandar Muar. Jamuan makanan besar-besaran lalu diadakan. Malim Demam juga ditabalkan menjadi raja. Tidak lama kemudian Malin Demam gering, lalu mangkat. Sejak kematian ayahanda, Malin Demam lalu memerintah negeri. Setiap hari ia asyik menyambung ayam saja.Latar yang terdapat dalam teks tersebut adalah latar &hellip;','1',' Tempat',' Waktu',' Suasana',' Sosial',' Budaya','A',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('42','1','42',' Salah satu bentuk karya sastra prosa lama yang isinya berupa cerita, kisah, dongeng maupun sejarah. Penyataan tersebut merupakan pengertian dari &hellip;','1',' Dongeng','Cerita','Cerita rakyat','Hikayat','Novel','D',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('43','1','43',' Dalam khazanah kesusastraan Indonesia kita mengenal berbagai karya sastra, salah satunya hikayat. Tokoh yang dikisahkan dalam hikayat biasanya &hellip;','1',' Seorang raja',' Presiden',' Istana ',' baginda dikerajaan',' Rakyat jelata','A',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('44','1','44',' Perhatikan kutipan teks berikut ini!Barang siapa yang melihatnya pastilah terpegun dan takjub akan keindahan dan kepelikan burung cenderawasih. Maka tak ada heranlah jika si Jelita banyak diinginkan oleh orang.Majas yang terdapat dalam kutipan teks tersebut adalah &hellip;','1','Antonomasia',' Hiperbola',' Simile',' Metafora',' Personifikasi','A',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('45','1','45',' Bacalah hikayat berikut! Maka kata Indera Bangsawan, &ldquo;Hamba ini tiada bernama dan tiada tahu akan bapak Hamba, karena diam dalam hutan rimba belantara. Adapun sebabnya hamba kemari ini karena hamba mendengar khabar anak raja sembilan orang hendak datang membunuh buraksa dan merebut tuan hamba dari padanya itu, itulah maka hamba datang kemari hendak melihat tamasya anak raja itu. Mengasihani hamba dan pada bicara akal hamba akan anak raja-raja yang sembilan itu tiadalah dapat membunuh buraksa itu. Jika lain daripada Indera Bangsawan tiada dapat membunuh akan buraksa itu.Amanat yang tersirat dalam kutipan sastra klasik tersebut adalah &hellip;','1','Basmilah jika melihat kejahatan',' Jangan menyombongkan diri',' Tunjukkanlah jika memiliki suatu kemampuan',' Hendaklah menolong orang yang dalam kesulitan',' Bersyukurlah jika mendapat pertolongan','D',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('46','1','46',' Bacalah penggalan hikayat berikut dengan saksama! Pengganti Hang Tuah di keraton adalah Hang Jebat. Sesungguhnya, ia menaruh dendam atas keputusan raja yang dijatuhkan kepada sahabatnya, Hang Tuah. Karena setia kepada sahabatnya, ia mengamuk di keraton. Putri-putri dan dayang-dayang diperlakukan kurang sopan sehingga banyak jugalah orang yang mati karena kerisnya, yang diberikan Hang Tuah kepadanya. Tiada seorang pun yang berani mendinginkan sehingga raja sendiri pun terlibat pula dalam kesulitan dan ketakutan.Dari kutipan cerita di atas kita dapat mengetahui bahwa Hang  Jebat berwatak &hellip;.','1','Pemberani',' Baik',' Sombong',' Setia',' Kasar','E',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('47','1','47',' Bacalah penggalan hikayat berikut!&rdquo;Janganlah adinda bertanya jua&rdquo; jawab baginda dengan sedihnya. &rdquo;Pertanyaan itu hanya menambah luka Tuanku jua semata.&rdquo;&rdquo;Ampun, Tuanku, orang yang arif tiada pernah putus asa sekali pun bagaimana juga cobaan yang datang ke atas dirinya. Tiada pula ia bersedih hati karena kesedihan tiada buahnya selain daripada menguruskan badan saja yang sudah ditakdirkan tiada juga akan tertolak olehnya.&rdquo;(Hikayat Kalilah dan Dimnah)Nilai moral yang tertuang dalam penggalan cerita di atas tampak pada perbuatan &hellip;.','1',' menghormati orang lain',' mendahulukan kepentingan umum',' menegur orang dengan bahasa yang sopan',' menolong orang yang sedang menderita',' membantu orang yang sedang bersedih hati','A',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('48','1','48',' Bacalah penggalan hikayat berikut!Tuan puteri memandang ke dayang kipas itu. Kesepuluhnya menyembah, lalu mengundurkan diri mengisut ke belakang perlahan-lahan. Bangkitlah Mak Inang, lalu duduk di tepi tilak tujuh bertindih, lalu mengumpulkan bunga melur yang terselit-selit di suara tuan puteri itu.Nilai yang terdapat pada penggalan tersebut adalah &hellip;.','1',' Sosial',' Moral',' Budaya',' Agama',' Pendidikan','C',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('49','1','49',' Bacalah penggalan hikayat &ldquo;Pengembara yang Lapar&rdquo; berikut!(1) &ldquo;Janganlah kamu berdua tamak sangat dan bercakap besar pula. (2) Aku pun lapar juga. (3) Bagi aku, kalau ada nasi sepinggan sudah cukup, &ldquo;Awang bersuara. (4) Kendi dan Buyung tertawa mendengar kata-kata Awang. (5) Dengan nasi sepinggan, mana boeh kenyang?Majas metafora pada kalimat tersebut ditandai dengan nomor &hellip;','1','1',' 2',' 3',' 4',' 5','A',NULL,'','','','','','');
