INSERT INTO `soal` VALUES ('257','2','7',' Batang pisang dikerap cukup dalam, kemudian batang pisang dirobohkan pelan-pelan. Caranya, salah satu pelepah daunnya ditarik sampai hampir roboh. Tandanya pisang jangan sampai membentur tanah agar tidak trusak. Sebelum tandan dekat ke tanah, ujung tandan dipegang dengan tangan atau disangga dengan alat yang telah disediakan.Kutipan tersebut merupakan bagian dari ...','1',' cara memanen buah pisang',' cara memanfaatkan buah pisang',' tanda-tanda buah pisang siap panen',' buah pisang sebagai bahan keripik pisang',' manfaat buah pisang selain sebagai buah meja','A',NULL,'','','','','','');
