INSERT INTO `soal` VALUES ('261','2','11',' Bacalah teks prosedur berikut!Daun cincau disiapkan di ember, lalu siram dengan air mendidih. Selama penyiraman dengan air mendidih daun diaduk-aduk dengan alat agar terjadi proses pelayuan yang merata. Air mendidih ini akan membuat daun yang semula keras dan kaku menjadi lemas dan tidak mengkilat. Air panas juga membantu proses penguapan, sehingga mengurangi aroma daun cincau. Kutipan tersebut adalah bagian isi yang menjelaskan tentang ...','1',' pemilihan bahan pembuatan cincau',' bahan-bahan pembuatan cincau',' salah satu langkah pembuatan cincau',' perlengkapan untuk pembuatan cincau',' manfaat ekonomis pembuatan cincau','C',NULL,'','','','','','');
