INSERT INTO `soal` VALUES ('265','2','15',' Baca dengan cermat kutipan tersebut!Rebuslah air bersih secukupnya sampai mendidih! Setelah itu, celupkan daun jeruk purut  beberapa saat agar daun itu menjadi lunak! Lalu, angkatlah daun jeruk purut itu dan tiriskan! Tumbuk selembar daun pandan dan diberi air matang! Setelah itu, peraslah untuk diambil airnya!Kata-kata yang bermakna perintah adalah ...','1',' rebuslah, celupkan, tumbuk, peraslah ',' secukupnya, beberapa, menjadi, mendidih',' rebuslah, beberapa, menjadi, diberi',' tiriskan, menjadi, beberapa, selembar',' selembar, pandan, peraslah, beberapa','A',NULL,'','','','','','');
