INSERT INTO `soal` VALUES ('271','2','21',' Perhatikan teks berikut!Kekeringan diklasifikasikan menjadi dua: kekeringan alamiah dan kekeringan antropogenik. Kekeringan alamiah terjadi akibat tingkat curah hujan di bawah normal dalam satu musim, kekurangan pasokan air permukaan dan air tanah, kekurangan kandungan air di dalam tanah sehingga tidak mampu memenuhi kebutuhan tanaman tertentu pada periode waktu tertentu pada wilayah yang luas, pasokan komoditi ekonomi kurang dari kebutuhan normal. Kekeringan antropogenik adalah kekeringan yang disebabkan oleh ketidakpatuhan pada aturan. Kekeringan antropogenik terjadi karena kebutuhan air lebih besar dari pasokan yang direncanakan akibat ketidak-patuhan pengguna terhadap pola tanam/pola penggunaan air dan kerusakan kawasan tangkapan air, sumber air akibat perbuatan manusia.Teks eksplanasi di atas dikembangkan dengan pola pengembangan &hellip;.','1',' Pengembangan proses',' Pengembangan sebab-akibat',' Pengembangan umum khusus',' Pengembangan deduksi',' Pengembangan induksi','B',NULL,'','','','','','');
