INSERT INTO `soal` VALUES ('273','2','23',' (1) Agar selalu terhindar dari bencana alam gempa bumi.(2) Penduduk dekat gunung berapi harus selalu waspada.(3) Gempa bumi sering terjadi di daerah gunung yang berapi.(4) Gempa bumi adalah getaran yang terjadi karena pergerakan lapisan bumi. Urutan kalimat tersebut yang tepat adalah ...','1',' (4), (3), (2), (1)',' (3), (2), (4), (1)',' (1), (3), (2), (4)',' (1), (2), (3), (4)',' (2), (1), (3), (4)','A',NULL,'','','','','','');
