INSERT INTO `soal` VALUES ('275','2','25',' Bahasa Indonesia yang digunakan sekarang berasal dari bahasa Melayu. Bahasa tersebut sejak lama digunakan sebagai bahasa perantara (lingua franca) atau bahasa pergaulan. Tidak hanya digunakan di kepulauan Nusantara, tetapi juga digunakan hampir di seluruh Asia tenggara. Hal ini diperkuat dengan ditemukannya prasasti-prasasti kuno yang ditulis dengan menggunakan bahasa Melayu. Teks eksplanasi tersebut menuangkan tentang pengetahuan tentang masalah/ fenomena ...','1',' alam',' sosial',' agama',' ekonomi',' budaya','E',NULL,'','','','','','');
