INSERT INTO `soal` VALUES ('277','2','27',' Bacalah teks berikut !(1) Gempa yang terjadi dalam perut bumi akan mengakibatkan munculnya tekanan ke arah vertikal sehingga dasar lautan akan naik dan turun dalam rentang waktu yang singkat.(2) Hal ini kemudian akan memicu ketidakseimbangan pada air lautan yang kemudian terdorong menjadi gelombang besar yang bergerak mencapai wilayah daratan.Teks eksplanasi di atas adalah ...','1',' penyebab gempa',' penyebab terjadinya tsunami',' akibat tsunami',' akibat gempa',' proses terjadinya laut','B',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('278','2','28',' acalah teks berikut !Teks tersebut terdiri dari pendahuluan dan rincian-rincian tentang sebab terjadinya gempa bumi. Bagian pendahuluan terdiri atas tiga paragraf  yang berisi pengertian gempa bumi dan jenis-jenisnya. Bagian perincian terdiri atas lima paragraf. Paragraf pertama membahas &hellip;Teks diatas adalah penilaian hasil analisis teks eksplanasi bagian ...','1',' kaidah',' bahasa',' struktur',' kesimpulan',' isi','C',NULL,'','','','','','');
