INSERT INTO `soal` VALUES ('292','2','42',' Bacalah kutipan teks berikut !Keberhasilan kita hari ini dan hari kemarin merupakan keberhasilan guru dan kedua orang tua kita yang dengan susah payah telah membesarkan dan membimbing kita, sehingga kita bisa meraih apa yang kita miliki hari ini. Pendidikan yang mereka ajarkan kepada kita, sungguh sangat berarti. Darah mereka yang mengalir di tubuh kita. Menjadi penguat dan penyegar hidup kita. Kasih sayang yang mereka tumpahkan, telah menjadi butiran-butiran mutiara yang tak ternilai harganya.Kepadamu ya tuhan, beri kami kesempatan untuk berbakti kepada orang tua dan guru-guru kami. Berikan kami keberanian untuk bersimpuh dipangkuannya, untuk meminta maaf dan do&rsquo;a ibu dan Bapak.Bapak ibu guru dan hadirin yang saya cintai inilah yang saya bisa ungkapan, semoga bermanfaat bagi kita sekalian. Mohon maaf bila ada kesalahan.Teks tersebut termasuk teks &hellip;','1',' pidato',' ceramah',' ekplanasi',' cerpen',' eksposisi','B',NULL,'','','','','','');
