INSERT INTO `soal` VALUES ('298','2','48',' Cermati teks berikut !Hadirin yang saya hormati. Tindakan mengkonsumsi narkotika dapat memicu timbulnya kejahatan. Selain itu, juga merupakan perbuatan yang keci. Oleh karena itu, kita harus jauhi agar selamat di dunia dan akhirat, serta lingkungan masyarakat menjadi tentram. Jadi, janganlah kita sekali-kali mencobanya, kita akan menanggung rugi seumur hidup. isi dari ceramag tersebut adalah &hellip;','1',' Manfaat narkotika bagi kesehatan',' Manfaat narkotika bagi dunia medis',' efek narkotika bagi lingkungan',' narkotika dan bahayanya',' cara menggunakan narkotika','D',NULL,'','','','','','');
