INSERT INTO `soal` VALUES ('658','3','10','Perhatikan pernyataan-pernyataan berikut!\n1.	Menjaga persatuan dan kesatuan bangsa.\n2.	Melaksanakan musyawarah mufakat dalam mengambil keputusan.\n3.	Menghormati hak asasi manusia.\n4.	Menjunjung tinggi hukum dan keadilan.\n5.	Mewujudkan kesejahteraan bagi seluruh rakyat Indonesia.\nPernyataan-pernyataan di atas yang merupakan penerapan nilai Pancasila adalah ....','1','1, 2, dan 3 ','2, 3, dan 4 ','3, 4, dan 5 ','4, 5, dan 1 ','5, 1, dan 2','A','','','','','','','');
