INSERT INTO `soal` VALUES ('670','3','24','Salah satu kebijakan pemerintah di bidang pendidikan adalah menetapkan konsep merdeka belajar, salah satunya dengan menghapus Ujian Nasional (UN) tahun 2021. Kebijakan tersebut bertujuan untuk memberikan keleluasaan kepada masing-masing sekolah khususnya dalam menentukan kelulusan siswanya. Selain itu, kegiatan belajar bisa dilakukan secara eksploratif bukan hanya di dalam ruangan kelas namun menyesuaikan dengan materi dan kondisi yang ada. Harapannya, sekolah bisa menjadi ruang belajar yang merdeka dan proses memanusiakan manusia.\n\nKebijakan pemerintah tersebut dilandasi oleh nilai Pancasila yaitu nilai ...','1','Ketuhanan dan kemanusian','Persatuan dan kemanusian','Kemanusian dan keadilan','Kerakyatan dan persatuan','Persatuan dan keadilan','C','','','','','','','');
INSERT INTO `soal` VALUES ('671','3','25','Komponen sistem pertahanan dan keamanan Republik Indonesia berdasarkan ketentuan Pasal 30 Ayat (2) UUD NRI 1945 adalah …','1','Tentara Nasional Indonesia merupakan komponen utama bidang pertahanan','Kepolisian Republik Indonesia merupakan komponen pendukung bidang pertahanan','Tentara Nasional Indonesia bersama rakyat merupakan komponen pendukung bidang pertahanan','Tentara Nasional Indonesia dan Kepolisian Republik Indonesia merupakan komponen cadangan sistem pertahanan','Kepolisian Republik Indonesia merupakan komponen utama bidang keamanan dan pertahanan','A','','','','','','','');
INSERT INTO `soal` VALUES ('672','3','26','Salah satu bentuk pembagian kekuasaan secara vertikal adalah pelimpahan wewenang dari pemerintah pusat kepada pemerintahan daerah provinsi. Pemerintahan daerah provinsi dilaksanakan oleh …','1','Gubernur/Wakil Gubernur dan DPRD Provinsi','Gubernur dan Wakil Gubernur','Gubernur dan Sekretariat Daerah','Gubernur/Wakil Gubernur dan Dewan Perwakilan Daerah','Gubernur/Wakil Gubernur dan Organisasi Perangkat Daerah','A','','','','','','','');
INSERT INTO `soal` VALUES ('673','3','27','Wakil Gubernur Jawa Barat, Uu Ruzhanul Ulum baru saja meluncurkan program pendidikan karakter berupa Ajengan Masuk Sekolah (AMS) yang bertujuan untuk meningkatkan keimanan dan ketaqwaan peserta didik agar memiliki moral, akhlak yang baik serta mampu untuk menciptakan kerukunan dan sikap toleran. Program ini sejalan dengan instruksi pemerintah pusat khususnya dalam fokus pendidikan karakter generasi muda bangsa Indonesia.\n\nKebijakan pemerintah tersebut dilandasi oleh nilai Pancasila yaitu nilai ...','1','Ketuhanan dan kemanusian','Persatuan dan kerakyatan','Kemanusian dan keadilan','Ketuhanan dan persatuan','Persatuan dan keadilan','D','','','','','','','');
INSERT INTO `soal` VALUES ('674','3','28','Pancasila sebagai ideologi terbuka bersifat aktual, dinamis, antisipatif dan senantiasa mampu menyesuaikan diri dengan perkembangan zaman, ilmu pengetahuan dan teknologi serta dinamika perkembangan aspirasi masyarakat. Keterbukaan ideologi Pancasila dapat dilihat dari nilai-nilai yang terkandung di dalamnya, meliputi nilai dasar, instrumental dan praksis. Makna dari nilai dasar adalah ...','1','Nilai yang terkandung dalam berbagai peraturan perundang-undangan','Nilai yang dapat dipraktikkan dalam kehidupan sehari-hari','Nilai yang diterima sebagai dalil yang berasal dari nilai kultural','Nilai yang diambil dari kepribadian bangsa dan negara Indonesia','Nilai yang esensial dari Pancasila dan memiliki tujuan, cita-cita, dan perjuangan bangsa','D','','','','','','','');
INSERT INTO `soal` VALUES ('675','3','29','Sebagai warga negara sudah sepatutnya kita wajib mendukung penyelenggaraan negara berorientasi kepada kepentingan rakyat dan merupakan perwujudan nilai-nilai Pancasila sebagai ideologi terbuka. Bersikap positif terhadap Pancasila sebagai ideologi terbuka adalah, kecuali ….','1','Menyaring budaya-budaya asing yang masuk baik secara langsung maupun tidak langsung','Bersikap terbuka terhadap perubahan yang berdampak pada kemakmuran bangsa','Mengembangkan prinsip toleransi, bekerja sama dan kekeluargaan dalam setiap perikehidupan','Mengembangkan kehidupan demokrasi yang disesuaikan dengan kebutuhan bangsa dewasa ini','Menyerap semua nilai-nilai yang masuk demi kemajuan bangsa pada era globalisasi sekarang ini','E','','','','','','','');
