INSERT INTO `soal` VALUES ('703','4','1','Ancaman terhadap kedudukan NKRI dapat berupa ancaman militer dan nonmiliter. Ancaman militer merupakan ancaman yang menggunakan kekuatan bersenjata yang terorganisir yang dinilai mempunyai kemampuan membahayakan kedaulatan, keutuhan, dan keselamatan NKRI. Contoh ancaman militer adalah ....','1','pemberontakan bersenjata','pemberontakan bersenjata','penyelundupan narkoba','penyebaran paham radikal','degradasi lingkungan','A','','','','','','','');
INSERT INTO `soal` VALUES ('704','4','2','Ancaman nonmiliter merupakan ancaman yang tidak menggunakan kekuatan bersenjata, tetapi dinilai mempunyai kemampuan membahayakan kedaulatan, keutuhan, dan keselamatan NKRI. Contoh ancaman nonmiliter adalah ....','1',' pemberontakan bersenjata','masuknya tenaga kerja asing','penyelundupan narkoba',' penyebaran paham radikal','degradasi lingkungan','D','','','','','','','');
INSERT INTO `soal` VALUES ('705','4','3','Ancaman terhadap kedudukan NKRI dapat berdimensi politik, ekonomi, sosial budaya, dan ideologi. Ancaman berdimensi politik yang membahayakan kedaulatan NKRI adalah ....','1','penyebaran paham radikal','masuknya tenaga kerja asing','penyelundupan narkoba','degradasi lingkungan','konflik antaretnis','E','','','','','','','');
INSERT INTO `soal` VALUES ('706','4','4','Ancaman terhadap kedudukan NKRI dapat berasal dari luar dan dalam negeri. Ancaman berdimensi ekonomi yang berasal dari luar negeri yang membahayakan kedaulatan NKRI adalah ....','1','masuknya tenaga kerja asing','penyelundupan narkoba','degradasi lingkungan','persaingan ekonomi',' konflik antaretnis','D','','','','','','','');
