INSERT INTO `soal` VALUES ('708','4','6','Ancaman terhadap kedudukan NKRI dapat bersifat internal dan eksternal. Ancaman internal adalah ancaman yang berasal dari dalam negeri. Contoh ancaman internal terhadap kedudukan NKRI adalah ....','1','pemberontakan bersenjata','masuknya tenaga kerja asing','penyelundupan narkoba','penyebaran paham radikal','degradasi lingkungan','A','','','','','','','');
